// src/pages/CartPage.js
import React, { useEffect, useState } from "react";
import { Box, Typography, Grid, Paper, Button, TextField } from "@mui/material";
import { getCart, removeFromCart, updateCartItem } from "../api/cart";
import { useNavigate } from "react-router-dom";

export default function CartPage() {
  const [items, setItems] = useState([]);
  const navigate = useNavigate();

  const fetch = () => {
    getCart().then(res => setItems(res.data)).catch(console.error);
  };

  useEffect(() => { fetch(); }, []);

  const handleRemove = (id) => {
    removeFromCart(id).then(fetch).catch(console.error);
  };

  const handleQty = (id, qty) => {
    if (qty < 1) return;
    updateCartItem(id, { quantity: qty }).then(fetch).catch(console.error);
  };

  // Convert selectedSingle object to readable text
  const formatSelections = (obj) => {
    if (!obj || typeof obj !== "object" || Object.keys(obj).length === 0)
      return "None";

    return Object.entries(obj)
      .map(([key, val]) => `${key}: ${val}`)
      .join(", ");
  };

  // Convert toppings array to text
  const formatToppings = (tp) => {
    if (!tp || tp.length === 0) return "None";

    if (typeof tp === "string") return tp; // In case backend stored string

    return tp.join(", ");
  };

  const total = items.reduce(
    (s, it) => s + (it.totalPrice ?? (it.basePrice * (it.quantity || 1))),
    0
  );

  if (!items.length) return <Typography sx={{ p: 3 }}>Your cart is empty.</Typography>;

  return (
    <Box sx={{ p: 2 }}>
      <Typography variant="h4" sx={{ mb: 3 }}>My Cart</Typography>

      <Grid container spacing={3}>
        {items.map((it) => (
          <Grid item xs={12} key={it.id}>
            <Paper sx={{ display: "flex", p: 2, alignItems: "center" }}>
              
              {/* IMAGE */}
              <img
                src={`/images/${it.image || it.product?.image}`}
                alt={it.name}
                style={{
                  width: 120,
                  height: 120,
                  borderRadius: 8,
                  objectFit: "cover",
                  marginRight: 16
                }}
              />

              {/* DETAILS */}
              <Box sx={{ flex: 1 }}>
                <Typography variant="h6">{it.name}</Typography>

                <Typography variant="body1">
                  <strong>Selections:</strong> {formatSelections(it.selectedSingle)}
                </Typography>

                <Typography variant="body1">
                  <strong>Toppings:</strong> {formatToppings(it.selectedToppings)}
                </Typography>
              </Box>

              {/* RIGHT SIDE */}
              <Box sx={{ textAlign: "right" }}>
                <TextField
                  type="number"
                  value={it.quantity}
                  onChange={(e) => handleQty(it.id, Math.max(1, parseInt(e.target.value || "1")))}
                  sx={{ width: 80, mb: 1 }}
                  InputProps={{ inputProps: { min: 1 } }}
                />

                <Typography variant="h6" sx={{ mb: 1 }}>
                  ₹{it.totalPrice ?? (it.basePrice * it.quantity)}
                </Typography>

                <Button color="error" onClick={() => handleRemove(it.id)}>Remove</Button>
              </Box>
            </Paper>
          </Grid>
        ))}
      </Grid>

      <Typography variant="h5" sx={{ mt: 3 }}>Total: ₹{total}</Typography>

      <Button
        variant="contained"
        fullWidth
        sx={{ mt: 3, p: 2, fontSize: "1.1rem" }}
        onClick={() => navigate("/checkout")}
      >
        PROCEED TO CHECKOUT
      </Button>
    </Box>
  );
}
